    [],nt"revision_timestamp": "2015-05-06T22:38:39.991607",nt"name": "miniature-active-space-radiation-dosimeter-project",nt"isopen":
    true,nt"url": null,nt"notes": "Space Micro will extend our Phase I R&amp;D
    to develop a family of miniature, active space radiation dosimeters/particle counters,
    with a focus on biological/manned dose levels. A single board design will support
    both manned level and space electronics level dosimetry needs. This is enabled by
    the density and features of commercial high density silicon semiconductor memory
    devices, coupled with innovative patented programming algorithms.rnWe plan to augment
    this core dosimeter technology with other emerging novel miniature radiation detectors
    to enhance single particle detection, including heavy ions and secondary neutrons.rnA
    flight dosimeter will be delivered to NASA for flight demo on ISS or other platform.rnSpace
    Micro will then commercialize for both NASA markets (manned and electronics grade
    levels) with a standard product offering through our established marketing channels.
